import React from 'react'
import { useState } from 'react'

export default function Interest() {
  const [int,setInt]=useState(["Web Development","App Development","Coding"]);
  return (
    <div>
        <h1>Interest</h1>
      int.map(()=>{
        <ul key={int+1}>
        <li>{int}</li>
      </ul>
      })
    </div>
  )
}
